	render (){
		const bookInfo = this.props.Data;

		console.log(bookInfo);
		console.log(bookInfo[0]);
		console.log(bookInfo.length);
		return (
			<Fragment>
				<div class="item-container">
				<Iteminfo imgUrl={DummyImage} bookName="asdf" bookAuthor="이창민" bookState="asdf" />
					<Iteminfo imgUrl={DummyImage} bookName="Test" bookAuthor={bookInfo[0].author} bookState="return" />
